import React from 'react';
import ReactDOM from 'react-dom';
import mywife ,{color,myname,mynames} from './App';


ReactDOM.render(
  <>
      <ol>
      <li>Nilam</li>
      <li>{mywife}</li>
      <li>{color}</li>
      <li>{myname()}</li>
      <li>{mynames()}</li>

      </ol>

  </>



  ,document.getElementById('root')
);
